import React from "react";
import Faq from "./FAQ.js";

export default class Footer extends React.Component {
  constructor(props) {
    super();

    this.state = { showFAQ: false };

  }

  toggleFAQ() {
    this.setState({
      showFAQ: !this.state.showFAQ,
    });
  }

  render() {
    const butter = "https://cdn.buttercms.com/gZJD5eJjTbCi9MzICoOr"
    return <div className="footer">

        <div className = "divider"></div>

        <table style={{"border-top": "2px solid #1b1b1b", "padding":"30px" }} className="footerTable">
        <tr>
      <td className="footerText" onClick={this.toggleFAQ.bind(this)}>CONTACT</td>
      <td className="footerText2">&#xA9; ERIK och SIMON 2020</td>
      <td className="footerText" onClick={this.toggleFAQ.bind(this)}>CONTACT</td>
      <td className="footerText2">&#xA9; ERIK och SIMON 2020</td>
      <td className="footerText" onClick={this.toggleFAQ.bind(this)}>CONTACT</td>
      </tr>
        </table>
        <div className = "divider"></div>
        <div className="FAQ" >{this.state.showFAQ ? <Faq closeFAQ={this.toggleFAQ.bind(this)} /> : null}</div>
        <img width="50px" scr={butter}/>
    </div>
  }




}
